.dataMonitor {
    height: calc(100vh - 135px);
    overflow: auto;
    padding: 16px;
    margin: 0 16px 16px 16px;
    background: #fff;
    border-radius: 8px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    .chartArea {
        height: 45%;
        margin-bottom: 24px;
        display: flex;
        justify-content: space-between;
        .left,.right {
            width: 47%;
            height: 100%;
            background: #fff;
            .title {
                font-size: 14px;
                font-weight: 700;
                color: #202224;
                line-height: 22px;
                display: flex;
                align-items: center;
                padding-left: 2%;
                i {
                    width: 12px;
                    height: 12px;
                    border-radius: 2px;
                    background: #79ac43;
                    margin-right: 8px;
                }
            }
        }
        .chartDom {
            width: 100%;
            height: 100%;
            background: #fff;
        } 
    }
}
